CREATE VIEW `opensips`.`core_user_subscriber` AS select `b`.`username` AS `username`,`b`.`password` AS `password`,`b`.`first_name` AS `first_name`,`b`.`domain` AS `domain`,`b`.`last_name` AS `last_name`,`b`.`email_address` AS `email_address`,`b`.`Accountcode` AS `Accountcode`,`b`.`Local_Extension_name` AS `Local_Extension_name`,`b`.`Local_Extension_number` AS `Local_Extension_number`,`b`.`External_Extension_name` AS `External_Extension_name`,`b`.`External_Extension_number` AS `External_Extension_number`,`b`.`Billing_Extension_number` AS `Billing_Extension_number`,`b`.`customer_name` AS `customer_name`,`b`.`call_rec` AS `call_rec` from (`ve_core`.`user` `a` left join `opensips`.`subscriber` `b` on((`a`.`subscriberID` = `b`.`id`)));
CREATE VIEW `opensips`.`stats_calls_subscriber` AS select `c`.`id` AS `id`,`c`.`call_id` AS `call_id`,`c`.`date` AS `date`,`c`.`called_station_id` AS `called_station_id`,`c`.`calling_station_id` AS `calling_station_id`,`c`.`status` AS `status`,`c`.`duration` AS `duration`,`c`.`domain` AS `domain`,`c`.`destination` AS `destination`,`c`.`answered_dest` AS `answered_dest`,`c`.`application` AS `application`,`c`.`huntgroup` AS `huntgroup`,`c`.`inbound` AS `inbound`,`s`.`username` AS `username`,`s`.`password` AS `password`,`s`.`first_name` AS `first_name`,`s`.`last_name` AS `last_name`,`s`.`email_address` AS `email_address`,`s`.`Accountcode` AS `Accountcode`,`s`.`Local_Extension_name` AS `Local_Extension_name`,`s`.`Local_Extension_number` AS `Local_Extension_number`,`s`.`External_Extension_name` AS `External_Extension_name`,`s`.`External_Extension_number` AS `External_Extension_number`,`s`.`Billing_Extension_number` AS `Billing_Extension_number`,`s`.`customer_name` AS `customer_name`,`s`.`call_rec` AS `call_rec` from (`ve_stats`.`calls` `c` left join `opensips`.`subscriber` `s` on(((`s`.`Local_Extension_number` = `c`.`called_station_id`) or (`s`.`Billing_Extension_number` = `c`.`called_station_id`))));